import React, {useState} from 'react';
import './App.css'; // Import your CSS file

function App() {
  const OrangeBorder = {
    top: '0', 
    left: '0',
    width: '100%',
    height: '40vh',
    backgroundColor: 'orange',
    position: 'absolute', 
    marginTop: '0',
    zIndex: '-1'
  };

  const SearchBar = () => {
    const [data, setData] = useState()

    function getData(val) {
      setData(val.target.value)
    }

    function submitSearch() {
      setData("Hello")                // CHANGE THIS CODE
    }

    return (
      <div className = "searchBar">
        <h1> {data} </h1>
        <input type="text" onChange={getData} style= {{ width: '150px', zIndex: '1', position: 'relative', left: '0px'}}></input>
        <button onClick={submitSearch} style= {{ width: '150px', height: '40px', zIndex: '1', position: 'relative'}}> Match! </button>
      </div>
    );
  };

  const Square = ({left, right, flex}) => {
    const squareStyle = {
      left: left,
      right: right,
      top: '55%',
      flex: flex,
    };

    return (
      <div className="square" style={squareStyle}>     
      </div>
    );
  };

  return (


    <div className="App">
      <div className="orange-border" style={{...OrangeBorder }}></div>
      <div className="search-bar-container">
        <SearchBar></SearchBar>
      </div>
      <div className="albumns-container">
      <Square></Square>
      <Square></Square>
      <Square></Square>

      </div>

    </div>
  );
}

export default App;





